        setTodos(todo)
    }

    return (
        <div className='todo-box'>
            <h1>Todo List</h1>
            <ul className='todo-list'>
                {AddTodo}
            </ul>
            <button onClick={AddTodo}>ADD TODO</button>
        </div> 
    )
}

